from typing import List

class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        def isAnagram(a, b):
            return sorted(a) == sorted(b)

        arr = []
        m, n = len(s), len(p)
        if n > m:
            return arr
        left, right = 0, 0
        in_block = False

        while True:
            #print(f'\tleft, right = {left}, {right}')
            if left > m-n:
                break
            if in_block:
                #print(f'\t\tin_block, left, right = {left}, {right}')
                left += 1
                if s[left-1] == s[right]:
                    arr.append(left)
                    #print(arr)
                    right += 1
                    if right >= m:
                        break
                else:
                    #left = right
                    left += 1
                    in_block = False
            elif s[left] in p:
                chunk = s[left:left+n]
                #print(f'\t\tchunk = {chunk}')
                if isAnagram(chunk, p):
                    arr.append(left)
                    #print(arr)
                    right = left + n
                    if right >= m:
                        break
                    in_block = True
                else:
                    left += 1
                    right += 1
            else:
                left += 1
                right += 1

        return arr

